import React, { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { Link } from "react-router-dom";
import { blockUser, getAllEmplyers } from "../../../actions/adminActions";
import Alert from "@mui/material/Alert";
import VisibilityIcon from "@mui/icons-material/Visibility";
import BookmarkIcon from "@mui/icons-material/Bookmark";
import Spinner from "react-bootstrap/Spinner";
import './jobss.css'
import CustomSpinner from "../../customSpinner/CustomSpinner";

const ActiveJobs = ({jobs}) => {

    const dispatch = useDispatch();
    const [keyword, setKeyword] = useState("");
    const [alert, setAlert] = useState(false);

    console.log(jobs);

    const Employers= ''
  return (
    <div className="jobPostPage">
    <div className="jobPost-box">
    <div className="middle">
      {alert ? (
        <Alert
          style={{ position: "fixed", top: "30px", right: "50px" }}
          severity="warning"
        >
          Loading !
        </Alert>
      ) : (
        ""
      )}
      <form >
        <input type="text" onChange={(e) => setKeyword(e.target.value)} />
        <button type="submit">Search</button>
      </form>
    </div>

    <div className="bottom">
      {jobs?.myJobs ? (
        Ejobs?.myJobs?.map((dt) => {
          return (
            <div key={dt?._id} className="talent-result">
              <div className="t-left">
                <img
                  src={
                    dt?.employeeData?.image
                      ? dt?.employeeData?.image
                      : "https://t3.ftcdn.net/jpg/03/46/83/96/360_F_346839683_6nAPzbhpSkIpb8pmAwufkC7c5eD7wYws.jpg"
                  }
                  alt=""
                />
                <div>
                  <p style={{ color: "#3ccf4e" }}>{dt?.name}</p>
                  {/* <h4>{dt?.userTitle.slice(0, 20)}. . .</h4> */}
                  <p>
                    total earend:{" "}
                    <strong>{dt?.employeeData?.totalEarned}</strong>
                  </p>
                </div>
              </div>

              <div className="t-right">
                {dt?.isBlocked ? (
                  <button
                    style={{
                      backgroundColor: "#FF6262",
                      border: "none",
                      padding: "10px 10px",
                      borderRadius: "5px",
                    }}
                  >
                    {" "}
                    <Link
                      onClick={(e) => {
                        dispatch(blockUser(dt?._id, keyword, dt?.userType));
                        setAlert(true);
                        setTimeout(() => {
                          setAlert(false);
                        }, 1500);
                      }}
                    >
                      {" "}
                      {dt?.isBlocked ? "unblock" : "block"}
                    </Link>
                  </button>
                ) : (
                  <button
                    style={{
                      backgroundColor: "#3ccf4e",
                      border: "none",
                      padding: "10px 10px",
                      borderRadius: "5px",
                    }}
                  >
                    {" "}
                    <Link
                      onClick={(e) => {
                        dispatch(blockUser(dt?._id, keyword, dt?.userType));
                        setAlert(true);
                        setTimeout(() => {
                          setAlert(false);
                        }, 1500);
                      }}
                    >
                      {" "}
                      {dt?.isBlocked ? "unblock" : "block"}
                    </Link>
                  </button>
                )}

                <button
                  style={{
                    borderRadius: "50%",
                    width: "45px",
                    height: "45px",
                    backgroundColor: "#75E6FF",
                    border: "none",
                    marginLeft: "10px",
                  }}
                >
                  {" "}
                  <Link to={`/user/publicView/${dt?._id}`}>
                    {" "}
                    {/* <VisibilityIcon style={{ color: "white" }} />{" "} */}
                  </Link>
                </button>
              </div>
            </div>
          );
        })
      ) : (
        <div style={{display: 'flex', justifyContent: 'center'}} >
      
            <CustomSpinner />
          
        </div>
      )}

      {Employers?.data?.length > 0 ? '': <div style={{width: '100%', display: 'flex', justifyContent: 'center'}} ><img style={{width: '300px', height: '300px'}} src="https://static.vecteezy.com/system/resources/previews/005/073/071/original/user-not-found-account-not-register-concept-illustration-flat-design-eps10-modern-graphic-element-for-landing-page-empty-state-ui-infographic-icon-vector.jpg" alt="" /></div>  }
    </div>
    </div>
  </div>
  )
}

export default ActiveJobs
